import Login from "../../component/Login";
import Register from "../../component/Register";
import Home from "../../component/Home";
const PublicRouting = [
  {
    path: "/",
    Component: Home,
    exact: true,
  },
  {
    path: "/login",
    Component: Login,
    // exact: true,
  },
  {
    path: "/register",
    Component: Register,
  },
];

export default PublicRouting;
